choices.text:
if (seed != null) {
	InputStream inputStream = seed.getInputStream();
	rnd.setSeed(FileCopyUtils.copyToByteArray(inputStream));
}
else {
	rnd.nextBytes(new byte[1]);
}

if (seed == null) {
	rnd.setSeed(System.currentTimeMillis());
}
else {
	InputStream inputStream = seed.getInputStream();
	rnd.setSeed(FileCopyUtils.copyToByteArray(inputStream));
}

